	    var autosize = coerce('autosize',
	        (layoutIn.width && layoutIn.height) ? false : 'initial');
	    coerce('width');
	    coerce('height');
	
	    coerce('margin.l');
	    coerce('margin.r');
	    coerce('margin.t');
	    coerce('margin.b');
	    coerce('margin.pad');
	    coerce('margin.autoexpand');
	
	    // called in plotAutoSize otherwise
	    if(autosize!=='initial') plots.sanitizeMargins(layoutOut);
	
	    coerce('paper_bgcolor');
	
	    coerce('separators');
	    coerce('hidesources');
	    coerce('smith');
