	        bgColor = opts.bgColor,
	        container = opts.container,
	        outerContainer = opts.outerContainer,
	
	        c0 = hoverData[0],
	        xa = c0.xa,
	        ya = c0.ya,
	        commonAttr = hovermode==='y' ? 'yLabel' : 'xLabel',
	        t0 = c0[commonAttr],
