	        var tx = g.select('text.nums')
	            .style('fill',contrastColor)
	            .call(Drawing.setPosition,0,0)
	            .text(text)
	            .attr('data-notex',1)
	            .call(svgTextUtils.convertToTspans);
	        tx.selectAll('tspan.line')
	            .call(Drawing.setPosition,0,0);
	
