	/**
	 * A private function to reduce the type checking clutter in spliceTraces.
	 *
	 * @param {Object|HTMLDivElement} gd
	 * @param {Object} update
	 * @param {Number[]} indices
	 * @param {Number||Object} maxPoints
	 * @return {Object[]}
	 */
