	    subplots.forEach(function(subplot) {
	        var plotinfo = fullLayout._plots[subplot];
	
	        plotinfo.xlines
	            .style('fill', 'none')
	            .classed('crisp', true);
	        plotinfo.ylines
	            .style('fill', 'none')
	            .classed('crisp', true);
	    });
